import React from 'react';
import api from '../services/OpenAI';

class PetNamesComponent extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            petNames: [],
            specie: '',
            api: api,
        }
    }

    componentDidMount(){
        this.state.api.post("nlp-pet-name/specie/"+this.state.specie).then(
            res =>{
                this.setState({ specie: res.data.specie });
                this.setState({ petNames: res.data.names});
            })
    }

    render(){
        return(
            <div className="result-pet-names">
            <ul>
                {console.log(this.state.petNames)}
                {this.state.petNames}
            </ul>
        </div>
        )
    }
}

export default PetNamesComponent;
